import logo from './logo.svg';
import './App.css';
import { ListeEleves } from './eleves/ListeEleves';
import { classe1, classe2 } from './eleves/Eleves';

function App() {
  return (
    <div>
      <h1>Classe 1 : </h1>
      <ListeEleves liste={classe1}/>
      <h1>Classe 2 : </h1>
      <ListeEleves liste={classe2}/>
    </div>
  );
}

export default App;
